column8:
・商品重量 717 g<br>
・商品の寸法 21.8 x 15.2 x 9.2 cm<br>
・車載 対応 <br>
・7インチ液晶 <br>
・モニタ バックカメラ対応 <br>
・リモコン切替もＯＫ♪ <br>
・7インチオンダッシュモニター解像度 480*234 <br>
・アスペクト比 16：9 <br>
・消費電力 6.5W <br>
・電源 DC12V <br>
・入力 映像だけ方式 NTSC/PAL自動切り替え <br>
■バックカメラコントロール入力装備<br>
　バックカメラの電源配線をバックランプから取り、
　カメラ映像配線は本品のカメラ入力に接続で<br>
　シフト連動で自動でモニターがバック画面に切り替わります。<br>
■バックカメラ入力に信号が無い時はビデオ入力の画面が写ります。<br>
電源直結 <br>
■車載接続用電源ケーブルで配線工事が必要です。<br>
＊説明書は英語版のみです。<br><style>
