【商品説明】
<br><br>
開いたときに、ブルーのLEDがついているため、<br>
夜でも車を汚さずにタバコを捨てることが可能です。<br>

又、車内に限らず、ご家庭でもご利用頂けます<br><br>


※LEDの特性上、若干光にムラが出る場合が御座います。
【送料】
